import Link from 'next/link'

export default () => (
  <Layout>
    <div>
      <h1>Magic 8 Ball</h1>
      <style jsx>{`
        h1 {
          font-family:"Arial";
          font-size:50px;
        }`}
      </style>
      </div>
  </Layout>
)

const userInput = (
  <div>
    <form className="question-input">
      <input type="text" ref="question" placeholder="Ask your question..."/>
      <input type="submit" value="Shake!"/>
    </form>
  </div>
);
